import Vue from 'vue'
import Router from 'vue-router'
import Regitster from "../views/login/Regitster.vue";
import Login from "../views/login/Login.vue";
import Success from "../views/login/Success.vue";

Vue.use(Router)

export default new Router({
  routes: [
    {
      path: '/',
      name: 'Login',
      component: Login
    },
    {
      path: '/register',
      name: 'Register',
      component: Regitster
    },
    {
      path: '/Success',
      name: '登录成功',
      component: Success
    }
  ]
})
